import './App.css';
import logo from'../logo.svg';
import Header from './Header';

function App() {
  return (
    <div>
      <Header pageTitle="Login" logoSrc={logo} />
      <H1>{props.pageTitle}</H1>
    </div>
  );
}


export default App;
